import * as THREE from 'three';

export class FiyShaderLine {
    constructor(){
        const linePoints = [
            new THREE.Vector3(0,0,0),
            new THREE.Vector3(-5,4,0),
            new THREE.Vector3(-13,0,0),
        ]
        // 创建曲线
        this.lineCure = new THREE.CatmullRomCurve3(linePoints);

        const points = new this.lineCure.getPoint(1000);
        // 创建几何体
        this.geometry = new THREE.BufferGeometry().setFromPoints(points);


        // 设置着色器材质
        this.shaderMaterial = new THREE.ShaderMaterial({
            vertexShader:`
                void main(){
                    vec4 modelPosition = modelMatrix * vec4( position, 1.0 );
                    gl_Position = projectionMatrix * viewMatrix * modelPosition;
                    gl_PointSize = 10.0;
                }
            `,
            fragmentShader:`
                void main(){
                    gl_FragColor = vec4(1.0,0,0,1.0);
                }
            `
        });


        this.mesh = new THREE.Points(this.geometry,this.shaderMaterial);

        // // 根据曲线生成 管道几何
        // this.geometry = new THREE.TubeGeometry(this.lineCure,100,0.2,2,false);
        // // 设置飞线的材质
        // // 创建纹理
        // const textLoader = new THREE.TextureLoader();
        // this.texture = textLoader.load('./textures/z_11.png');
        // this.texture.repeat.set(1,2);
        // this.texture.wrapS = THREE.RepeatWrapping;
        // this.texture.wrapT = THREE.MirroredRepeatWrapping;


        // this.material = new THREE.MeshBasicMaterial({
        //     color:0xfff000,
        //     map:this.texture,
        //     transparent:true
        // });

        // // 创建飞线物体
        // this.mesh = new THREE.Mesh(this.geometry ,this.material );


        // // 创建飞线动画
        // gsap.to(this.texture.offset,{
        //     x:-1,
        //     duration:3,
        //     repeat:-1,ease:'none'
        // })
    }
}
